import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Router, hashHistory as history } from 'react-router';
import routes from './routes';

ReactDOM.render(
  <Router routes={routes} history={history} />,
  <App />,
  document.getElementById('root')
);
